import {
  //findTheDifference,
  //findTheDifference1 as findTheDifference,
  findTheDifferenceUseHash as findTheDifference
} from './389-find-difference';

describe('find difference test case', () => {
  // it('s is null', () => {
  //   expect(findTheDifference(('', ''))).toEqual('');
  // });

  it('s is not null', () => {
    expect(findTheDifference('abcd', 'abcde')).toEqual('e');
    expect(findTheDifference('abcdx', 'abcdex')).toEqual('e');
    expect(findTheDifference('abacabac', 'abacaback')).toEqual('k');
  });

  it('t is a duplicate', () => {
    expect(findTheDifference('a', 'aa')).toEqual('a');
    expect(findTheDifference('b', 'bb')).toEqual('b');
  });

  it('s is long string', () => {
    let s = '';
    let t = "";
    expect(findTheDifference(s, t)).toEqual('t');
  });

});
